import { Link } from "react-router-dom";
import styled from "styled-components";
import './App.css';

const Li=styled.li`
    list-style-type : none;
    margin-right:50px;
`;
export default function Home(){
    return(
        <div className="position">
            <Li>
                <NavLink to='./timer' className="line">타이머</NavLink>
            </Li>
            <Li>   
                <NavLink to='./rank' className="line">랭킹</NavLink>
            </Li>
            <Li>
                <NavLink to='./login' className="line">로그인</NavLink>
            </Li>
            <Li>
                <NavLink to='./SignUp' className="line">회원가입</NavLink>
            </Li>
        </div>
    );
}
